    false,nt"url": null,nt"notes": "This narrative report for Red Rock Lakes
    National Wildlife Refuge outlines Refuge accomplishments from January through April
    of 1948. The report begins by summarizing the weather conditions, water conditions,
    and food and cover during this period. Wildlife- including migratory birds, big
    game animals, furbearers, predators, rodents, mammals, and fish- is also covered.
    The Refuge development and maintenance section discusses physical developments,
    plantings, and collections and receipts. Resource management is outlined; topics
    include grazing, haying, and fur harvesting. A progress report on field investigations
    and applied research is also provided. The public relations section of the report
    describes recreational uses, Refuge visitors, Refuge participation, hunting, and
    fishing. Items of interest, N-R forms, and photographs are attached.",nt"owner_org":
